def compute_sum_of_D(A, B):

    def S(N):
        sum_odd = 0
        sum_even = 0
        while N > 0:
            digit = N % 10
            if digit % 2 == 0:
                sum_even += digit
            else:
                sum_odd += digit
            N //= 10
        return sum_odd + 2 * sum_even

    def D(N):
        return S(N) % 10

    def getAns(A):
        if A <= 0:
            return 0
        ans = 0
        while A % 10 != 0:
            ans += D(A)
            A -= 1
        return ans + 45 * (A // 10) + D(A)
    return getAns(B) + getAns(A - 1)

